import React,{useState} from 'react'
import logo from '../../assets/images/sankalptaru-new-logo-white.png'
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import PersonIcon from '@mui/icons-material/Person';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { useMediaQuery ,useTheme} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
}));

const Header = () => {
  const [ismenuclicked,setismenuclicked] =useState(false);
  const [iscrossclicked,setiscrossclicked] =useState(false);
  const navigate=useNavigate();
  const theme=useTheme();
  const matches=useMediaQuery(theme.breakpoints.down('md'));
  return (
    <div className='headercontainer'>
            <Box style={{display:"flex", alignItems:"center", justifyContent:"space-between"}}>
                <Box >
                <img src={logo} id='logo' onClick={()=>navigate("/")} style={{marginLeft:"5px",height:"70px"}}></img>
                </Box>
                {matches? "":
                <Box style={{display:"flex", alignItems:"center"}}>
                <Box className='boxheader'>
                    <Item onClick={()=>navigate("/AboutUs")} className='headertags'>ABOUT US</Item>
                </Box>
                <Box>
                    <Item className='headertags'>GALLERY</Item>
                </Box>
                <Box>
                    <Item className='headertags'>BLOGS</Item>
                </Box>
                <Box>
                    <Item  onClick={()=>navigate("/ContactUs")}className='headertags'>CONTACT</Item>
                </Box>
                <Box>
                    <Item onClick={()=>navigate("/PlantNow")}className='headertags'>PLANT A TREE</Item>
                </Box>
                </Box>}


                <Box style={{display:"flex",alignItems:"center", margin:"25px 10px 10px 10px", justifyContent:"center"}}>


                  <Box style={{marginRight:"10px"}}>
                  <Box className='rightheader' >
                    <ShoppingCartIcon  style={{color: "white",fontSize:"25px",display:"block"}}/>
                  </Box>
                  <Box>
                    <p style={{color: "white",marginTop:"2px", fontSize:"15px"}}>CART</p>
                  </Box>
                  </Box>

                  <Box style={{marginRight:"5px"}}>
                  <Box className='rightheader' >
                    <AccountCircleIcon onClick={()=>navigate("/Login")} className='loginbuttonheader' style={{color: "white",fontSize:"20px"}}/>
                  </Box>
                  <Box>
                    <p onClick={()=>navigate("/Login")} className='loginbuttonheader' style={{color: "white",marginTop:"2px", fontSize:"15px"}}>LOGIN</p>
                  </Box>
                  </Box>

                  <Box style={{marginRight:"10px"}}>
                  <Box className='rightheader' >

                  {ismenuclicked?
                    <MenuIcon onClick={()=>{navigate("/Menu");setismenuclicked(true)}} className='loginbuttonheader' style={{color: "white",fontSize:"25px",display:"block"}}/>:
                    <CloseIcon onClick={()=>{navigate("/")}} className='loginbuttonheader' style={{color: "white",fontSize:"25px",display:"block"}}/>}

                  </Box>
                  <Box>
                    <p onClick={()=>navigate("/Menu")} className='loginbuttonheader'style={{color: "white",marginTop:"2px", fontSize:"15px"}}>MENU</p>
                  </Box>
                  </Box>

                </Box>
            </Box>
    </div>
  )
}

export default Header
